import React from 'react';
import image1 from '../images/image1.jpg';
import image2 from '../images/image2.png';
import image3 from '../images/image3.webp';
import image4 from '../images/image4.webp';
import image5 from '../images/image5.jpg';
import Cards from "./Cards/Cards";
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Footer from './Footer'; // Assuming Footer is imported from a separate file

function Home() {
    var cardStyle = {
      margin: "80px",
      padding: 0
    };

  return (
    <div>
        {/* Navbar */}
        <Navbar bg="primary" variant="dark">
            <Navbar.Brand href="/">Job website</Navbar.Brand>
            <Nav className="me-auto">
                <Nav.Link href="/">Home</Nav.Link>
                <Nav.Link href="/about">About</Nav.Link>
                <Nav.Link href="/contact">Contact</Nav.Link>
                <Nav.Link href="/jobs">Jobs</Nav.Link>
                <Nav.Link href="/companies">Company Showcase</Nav.Link>
            </Nav>
        </Navbar>

        <header className="py-5 bg-light border-bottom mb-4">
            <div className="container">
                <div className="text-center my-5">
                    <h1 className="fw-bolder">Welcome to Home!</h1>
                    <p className="lead mb-0">Lorem ipsum dolor sit amet Lorem ipsum dolor sit amet</p>
                </div>
            </div>
        </header>
        <div className="container">
            <div className="row">
                <div className="col-lg-8">
                    {/* Cards */}
                    <div className="card mb-4">
                        {/* Card content */}
                    </div>
                    {/* Pagination */}
                    <nav aria-label="Pagination">
                        {/* Pagination content */}
                    </nav>
                </div>
                <div className="col-lg-4">
                    {/* Sidebar */}
                    <div className="card mb-4">
                        {/* Sidebar content */}
                    </div>
                </div>
            </div>
        </div>
        {/* Cards component */}
        <Cards id="Home"></Cards>
        {/* Footer */}
        <Footer/>
    </div>
  )
}

export default Home;
